import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './Components/Navbar';
import About from './Component/About';

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="D:\React\text-editor\src\App.js" element={<About />} />
      </Routes>
    </Router>
  );
}

export default App;
